Here is example Redfish "MultiFactorAuth" property 

 "MultiFactorAuth": {
        "SecurID": {
            "Enabled": true,
            "ServerURI": "https://rsa.internal.contoso.com:5555",
            }
        },
        "GoogleAuthenticator": {
            "Enabled": false,
        },
        "MicrosoftAuthenticator": {
            "Enabled": false,
        },
        "ClientCertificate": {
            "Enabled": true,
            "CertificateMappingAttribute": "CommonName"
        }
}

each multi-factor authentication type has corresponding properties
so added these separate properties for each type.
